import React from 'react';
import { View, Text } from 'react-native-web';

const Main = () => {
    return (
        <View>
            <Text>Otro componente</Text>
        </View>
    );
};

export default Main;
const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#000',
      alignItems: 'center',
      justifyContent: 'center',
    },
    Text: {
      color: '#fff'
    }
  });
